import React from 'react';
// import 'inicial.css';

function home() {
  return (
    <div className="App">
      <header className="App-header">
        <button>Botão 1</button>
        <button>Botão 2</button>
        <button>Botão 3</button>
      </header>
    </div>
  );
}

export default home;
